import React from 'react';
import Header from '../components/Header';
import Body from '../components/Body';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';
import styled from 'styled-components';
import ProductsCard from '../components/ProductsCard';




const Home = () => {
    return (
        <div>
            <Navbar />
            <Header 
            headerImage='./images/header-pic2.jpg' 
            />         
            <Body 
                img="./images/doctor2.png" 
                title="Empowering Health Enhancing Lives"
                description = "Your One-Stop Destination for Exceptional Healthcare Solutions"
                headingPartOne="Welcome to "
                headingPartTwo="Twokay chemicals"
                content="A distinguished pharmaceutical distributor and wholesale chemist, embarked on its journey in 1992 and has since grown into a leading player in the healthcare industry. Guided by a mission to conduct business with a caring heart, the company is committed to providing high-quality healthcare solutions that positively impact the lives of patients and healthcare professionals alike."
            />

            <ProductsDiv>

                <div className='product-title'>
                    <h1>Our products</h1>
                </div>
                
                <div className='productsection'>
                <ProductsCard 
                Img="https://static.pexels.com/photos/7096/people-woman-coffee-meeting.jpg"
                alt="Photo of sunset"
                title = "Hospital disposables"
                description = "This is a company that builds websites, web apps and e-commerce solutions."
                />
                <ProductsCard 
                Img="https://static.pexels.com/photos/7096/people-woman-coffee-meeting.jpg"
                alt="Photo of sunset"
                title = "Pharmaceuticals "
                description = "This is a company that builds websites, web apps and e-commerce solutions."
                />

                </div>
                
            </ProductsDiv>
            
            <ValuePropotionDiv>

            <div className="products-intro-container">
                
            <div className='titlesection'>
                <h1>Why Us?</h1>
                <p>Discover the compelling reasons why Twokay Chemicals stands out as your trusted partner in pharmaceutical distribution and medical equipment supply. Explore our core strengths, values, and the unique advantages that set us apart in the healthcare industry.</p>
            </div>
            <div className='contentsectioncontainer'>
            <div className='contentcontainer'>
                <div className='contentsection first'>
                <img className='icon' src='../images/high-quality.png' alt='best quality' />
                <h2>Reliable Quality Assurance</h2>
                <p>ls is committed to ensuring that every pharmaceutical product and medical equipment we offer undergoes rigorous quality control measures to meet and exceed industry standards.</p>
                </div>

                <div className='contentsection second'>
                <h2>Extensive Product Portfolio</h2>
                <p>With an extensive range of pharmaceuticals, medical equipment, and disposables, we provide comprehensive solutions for healthcare institutions. Our diverse product selection caters to a wide spectrum of medical needs, simplifying procurement for our clients.</p>
                </div>

            </div>
            <div className='contentcontainer'>
                <div className='contentsection third'>
                
                
                <h2>Proven Track Record</h2>
                <p>With over three decades of experience, Twokay Chemicals has established a solid reputation for reliability and integrity in the pharmaceutical distribution industry. Our long-standing relationships with clients and partners are a testament to our commitment to excellence.</p>
                </div>

                <div className='contentsection fourth'>
                <h2>Customer-Centric Approach</h2>
                <p>Our unwavering focus on customer satisfaction means that we work closely with our clients to understand their unique needs. We are dedicated to providing personalized solutions, exceptional service, and prompt support to ensure their success.</p>
                </div>
            </div>
            </div>

            
            
            </div>
            </ValuePropotionDiv>

            
            
            <Footer />
        </div>
    )
};

const ValuePropotionDiv = styled.div`
width: 100wv;
height: auto;

.products-intro-container {
    margin: 100px 200px;


    .contentsectioncontainer {
        width: 100%;
        display: flex;
        flex-direction: column;
        

    }

    .contentcontainer {
        display: flex;
        padding-bottom: 20px;
      
    }

    .first {
      padding-right: 50px;
     
    }

    .second {
      
    }

    .third {
        padding-right: 50px;  
    }
    
    .fourth {
       
    }

    .contentsection {
        display: flex;
        flex-direction: column;
        width: 100%;

        img {
            height: 40px;
            width: 40px;
            justify-content: center;
            align-items: center;
        }
        
    
        h1{
            color: #474747;
            font-family: 'Allura', cursive;
            font-weight: 300;
            line-height: 40px;
            font-size: 40px;
        }
    
        h2 {
            font-family: 'Poppins', sans-serif;
            font-size: 20px;
            font-weight: 400;
            line-height: 35px;
            color: rgb(59, 94, 103);
        }
    
        p {
            color: #474747;
            text-align:justify;
            line-height: 27px;
        }

    }

}

.titlesection {
    padding-bottom: 50px;

    h1 {
        color: black;
        font-family: 'Allura', cursive;
        font-weight: 300;
        line-height: 40px;
        font-size: 40px;
    }

    p {
        margin-right: 60px;
        text-align: justify;
        line-height: 27px;
        color: #474747;
        line-height: 27px;
    }
}

`
const ProductsDiv = styled.div`
margin: 100px 200px;

.productsection {
    width: 100wv;
    height: auto;
    display: flex;
    justify-content: space-between;
}

.product-title {
    font-family: Playfair Display,serif;
    font-weight: 300;
    line-height: 48px;
    font-size: 45px;
    color: #2a2a2a;
    padding-bottom: 20px;
}


